import React, { useEffect } from 'react';

function Home(){
    useEffect(() => {
        window.location.reload();
        // eslint-disable-next-line react-hooks/exhaustive-deps
      }, []);

    return (
        <h1>Home page</h1>
    )
}

export default Home;
